  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Maxwell NWR for the next 15 years. This plan
  outlines the Refuge vision and purpose and describes how Maxwell NWR will contribute
  to the overall mission of the Refuge System. The plan provides an introduction to
  the Refuge, an overview of the CCP process, a summary of Refuge resources, information
  about the management direction, strategies for implementation, and administration.
  Key planning issues include: biological information, grasslands management, water
  management, public use, interagency coordination, and funding.\",\n\t\"license_title\":
